import React, { Component } from 'react'
import SearchFilterCountry from '../components/SearchFilterCountry';

export default class Subscribe extends Component {

    constructor(props) {
        super(props)
    
        this.state = {
            isSignUp : false,
             user : {
                 name : "",
                 email : "",
                 password : "",
                 confirmPassword : ""
             }
        }

        this.onSubmit = this.onSubmit.bind(this);

    }

    onSubmit = (event) => {

        const {isSignUp} = this.state;
        event.preventDefault();

        console.log("SIGN UP TRUE : ", isSignUp ? "login" : "register");

    }
    

    render() {
        return (
        <div className="app-subscribe-component">
            <div className="app-login-form-inner">
                    <h2 className="form-title">Sign up for Tetawood-Transfer Pro</h2>
                    
                    <form className="app-form-subscribe" onSubmit={this.onSubmit}>
                        <div className="app-form-subscribe-item">
                            <input id="name-id" type="text" placeholder="Full name" name="name" />
                        </div>
                        <div className="app-form-subscribe-item">
                            <input id="email-id" type="email" placeholder="Email Address" name="email" />
                        </div>
                        <div className="app-form-subscribe-item">
                            <input id="password-id" type="password" placeholder="Password" name="password" />
                        </div>
                        <div className="app-form-subscribe-item">
                            <input id="password-confirm-id" type="password" placeholder="Confirm Password" name="confirmPassword" />
                        </div>
                        <div className="app-billing-header">
                            <h1>You Billing Informations</h1>
                        </div>
                        <div className="app-form-subscribe-item">
                            <input id="company-id" type="text" placeholder="Company (Optionnal)" name="company" />
                        </div>
                        <div className="app-form-subscribe-item">
                            <input id="vat-id" type="text" placeholder="VAT (Optionnal)" name="vat" />
                        </div>
                        <div className="app-form-subscribe-item">
                            <input id="address-id" type="text" placeholder="Address" name="address" />
                        </div>
                        <div className="app-form-subscribe-item">
                            <input id="city-id" type="text" placeholder="City (Optionnal)" name="city" />
                        </div>
                        <div className="app-form-subscribe-item">
                            <input id="zip-id" type="text" placeholder="Zip code (Optionnal)" name="zip" />
                        </div>
                        <div className="app-form-subscribe-item">
                            <SearchFilterCountry />
                        </div>
                        <div className="app-form-actions">
                            <button className="app-subscribe-button primary" onClick={() => {
                                this.setState({
                                    isSignUp : true
                                })
                            }}>Complete your order</button>
                        </div>
                    </form>
                </div>
        </div>
    )
    }
}
